export default function SubNavegador({category1, category2, category3}){
  const navStyles2={
    maxWidth: 1200,
    display:"flex",
    justifyContent: "flex-end",
    alignItems: "center",
    gap:40,
    listStyle: "none",
    color: "white",
    margin: "0 auto"
}
  return(

        <ul className="links" style={navStyles2}>
            <li>{category1}</li>
            <li>{category2}</li>
            <li>{category3}</li>
        </ul>

  )}
